		</div>
		<script>
			document.addEventListener("DOMContentLoaded", function() {
				document.querySelectorAll("circle").forEach( (a) => {
					MorphSVGPlugin.convertToPath(a);
				})
				document.querySelectorAll("rect").forEach( (a) => {
					MorphSVGPlugin.convertToPath(a);
				})
				
				let smiley = document.querySelector(".smiley");
				let svg = smiley.querySelector("svg");
				let smile = document.querySelector(".smile-0")
				let rightEye = document.querySelector(".eye-right-0")
				let leftEye = document.querySelector(".eye-left-0")
				let leftPupil = document.querySelector(".pupil-left-0")
				let rightPupil = document.querySelector(".pupil-right-0")

				let colors = [
					/*yellow*/ "#fddd46",
					/*cyan*/ "#6bdada",
					/*green*/ "#b1e45b",
					/*blue*/ "#0a84ff"
				];

				let viewBox = [
					/*face1*/ "0 0 509.75 537",
					/*face2*/ "0 0 705.12 513",
					/*face3*/ "0 0 606.08 560",
					/*face4*/ "0 0 563.01 546",
				]
				window.changeFace = function(i) {
					tl = gsap.timeline();

					tl.to(smiley, {
						background: colors[i],
						duration: 0.5,
					}, 0)
					.to(svg, {
						attr: { 
							// zoom out
							viewBox: "0 0 700 560"
						},
						duration: 0.1,
					}, 0)
					.to(smile, {
						morphSVG:`.smile-${i}`, 
						fill:"transparent", 
						stroke:"black", 
						duration: 0.2,
					}, 1)
					.to(rightEye, {
						morphSVG:`.eye-right-${i}`,
						duration: 0.33,
					}, 0)
					.to(rightPupil, {
						morphSVG:`.pupil-right-${i}`,
						duration: 0.33,
					}, 0)
					.to(leftEye, {
						morphSVG:`.eye-left-${i}`,
						duration: 0.33,
					}, 0)
					.to(leftPupil, {
						morphSVG:`.pupil-left-${i}`,
						duration: 0.33,
					}, 0)
					.to(svg, {
						attr: { 
							viewBox: viewBox[i]
						},
						duration: 0.1,
					}, 0);
				}

				gsap.registerPlugin(ScrollTrigger);

				gsap.set(".image-container>img", {
					zIndex: (i, target, targets) => targets.length - i
				});

				let images = gsap.utils.toArray('.image-container>img');
				let texts = gsap.utils.toArray('.text-container>div');
				let backgroundColors = ["#fbf7e3", "#e7efef", "#ecf6da", "#d6e9fb"];

				images.forEach((image, i) => {
					if ( i == 3 ) return;
					let tl = gsap.timeline({
						scrollTrigger: {
							trigger: "#pin",
							// snap: {
							// 	snapTo: 0.5,
							// 	duration: { min: 0.4, max: 1 },
							// 	delay: 0.1
							// },
							onToggle: (self)=> {
								image.classList.toggle('wavy')
							},
							start: () => "top -" + (window.innerHeight * (i + 0.5)),
							end: () => "+=" + window.innerHeight,							
							scrub: true,
							toggleActions: "play none reverse none",
							invalidateOnRefresh: true,
						}
					})
					tl.to(image, {
						y: "-120%"
					});

				});

				texts.forEach((text, i) => {
					let tl = gsap.timeline({
						scrollTrigger: {
							trigger: "#pin",
							start: () => "top -" + (window.innerHeight * i),
							end: () => "+=" + window.innerHeight,
							scrub: true,
							// snap: {
							// 	snapTo: 0.3,
							// 	duration: { min: 0.7, max: 1 },
							// 	delay: 0.2
							// },
							onEnter: ()=> {
								changeFace(i)
								document.body.style.background = backgroundColors[i];
							},
							onEnterBack : ()=> {
								document.body.style.background = backgroundColors[i];
								changeFace(i)
							},
							toggleActions: "play none reverse none",
							invalidateOnRefresh: true,
						}
					})
					if ( i == 3 ) {
						tl.to(text, {
							duration: 0.33,
							opacity: 1,
							y: "0%"
						});
						return;
					};
					tl.to(text, {
						duration: 0.33,
						opacity: 1,
						y: "0%"
					}).to(text, {
						duration: 0.33,
						opacity: 0,
						//y: "-100%"
					}, 0.66);
				});


				ScrollTrigger.create({
					trigger: "#pin",
					scrub: true,
					// markers: true,
					pin: true,
					start: () => "top center-=250px",
					end: () => "+=" + ((images.length) * window.innerHeight),
					onEnter: () => {
						gsap.to(document.body, {
							duration: 0.33,
							background: backgroundColors[0]
						})
					},
					onLeave: () => {
						// gsap.to(document.body, {
						// 	duration: 0.33,
						// 	background: "white"
						// })
					},
					onLeaveBack: () => {
						gsap.to(document.body, {
							duration: 0.33,
							background: "white"
						})
					},
					invalidateOnRefresh: true,
				});


				document.forms[0].addEventListener("submit", (event) => {
					event.preventDefault();
					let form = event.target;
					let loader = form.querySelector(".loader");
					let error_message = form.querySelector(".error-message>.messages");
					function addFormError(id, msg){
						let html = document.createElement("div");
						html.classList.add("font-light")
						html.classList.add("mb-2")
						html.id = id;
						html.innerHTML = msg;
						error_message.appendChild(html)
					}

					let output = new FormData(form)
					output.append("status", "2");
					output.append("owner.first_name", "fn");
					output.append("owner.last_name", "ln");

					//output.append("company_type", "channel_partner");

					let payload = {
						owner: {},
						address: {}
					};

					for (const [key, value] of output) {
						let ownerObj = key.match(/(?:owner.)(.+)/);
						let addressObj = key.match(/(?:address.)(.+)/);
						console.log(key, value)
						if (!!ownerObj){
							payload["owner"][`${ownerObj[1]}`] = value
							continue;
						}
						if (!!addressObj){
							payload["address"][addressObj[1]] = value;
							continue;
						}
						payload[key] = value;
					}

					loader.classList.toggle("active")
					const api = `https://uat-services.snippit.com.au/api/v1/companies/`;
					// const mock = `https://7ac49849-ee4e-4143-a782-e77dc4fbbbe0.mock.pstmn.io/api/v1/companies/`;
					fetch(api, {
						method: "POST",
						headers: {
							'Accept': 'application/json',
							'Content-Type': 'application/json'
						},
						body: JSON.stringify(payload),
					}).then(function(data){
						loader.classList.toggle("active")

						data.json().then((res) => {
							// remove old messages
							error_message.querySelectorAll("div").forEach(s=>s.remove())
							if (data.status !== 201){
								form.classList.add("has-error")
								addFormError(999, 'An error has occured, please check the fields and try again');
								if (res.constructor===Object){
									for (err in res){
										if (res[err].constructor === Object){
											for (msg in res[err]){
												addFormError(msg, `Error with <b>${msg.split("_").join(" ")}</b>: ${res[err][msg]}`)
											}
										}else{
											addFormError(err, `Error with <b>${err.split("_").join(" ")}</b>: ${res[err]}`)
										}
									}
								}
							}else{
								form.classList.remove("has-error");
								addFormError(1, "Registered sucessfully, <br> please check your e-mail for further instructions.");
								form.reset();
							}
						})
					});
				})



				
				var app = document.getElementById('hero-text');

				var typewriter = new Typewriter(app, {
					loop: false,
					delay: 50
				});

				window.banner = gsap.timeline();
				let mm = gsap.matchMedia();


				typewriter.typeString('Connect. ')
					.pauseFor(300)
					.typeString('Collaborate. ')
					.pauseFor(300)
					.typeString('Conquer.')
					.callFunction(()=>{
						banner.to("[hero] .subtitle", {duration: 0.4, opacity: 1, scale: 1, bottom: '550px'})
						banner.to("[hero] .bns-text", {duration: 0.4, opacity: 1, scale: 1})
						banner.to("[hero] .bns-btn", {duration: 0.4, opacity: 1, scale: 1})
					})
					.start();



				const mobileAnimation = () => {
					
				} 
				
				const desktopAnimation = () => {
					banner.to(".s", {duration: 0.4, left: '-80px'})
					banner.to(".square", {duration: 0.4, right: '30px'})
					banner.to(".grey", {duration: 0.4, bottom: '-200px'})
					banner.to(".phone", {duration: 0.7, bottom: 0})
					banner.to(".gradient", {duration: 1, scale: 1})
					banner.to(".ss-center", {duration: 0.7, bottom: '300px'})
					banner.to(".buyers-sellers", {duration: 0.4, bottom: '190px', opacity: 1})
					banner.to(".notification-1", {duration: 0.4, bottom: '150px'})
					banner.to(".notification-2", {duration: 0.4, bottom: '50px'})
					banner.to(".notification-3", {duration: 0.4, bottom: '-50px'})

					banner.to(".left-line", {duration: 0.4, left: '285px', scale: 1, opacity: 1})
					banner.to(".right-line", {duration: 0.4, right: '560px', scale: 1, rotate: 10, opacity: 1}, "<")

					banner.to(".assessment", {duration: 0.4, bottom: '230px', opacity: 1})
					banner.to(".transaction", {duration: 0.4, bottom: '420px', opacity: 1})
					banner.to(".enjoy", {duration: 0.4, bottom: '200px', opacity: 1})
					banner.to(".stars", {duration: 0.4, scale: 1, rotate: 0})
					
				}
				mm.add("(min-width: 767px)", () => {
					// desktop setup code here...
					desktopAnimation()
				});

				mm.add("(max-width: 768px)", () => {
					// mobile setup code here...
					mobileAnimation()
				});



			})
			
		</script>
<?php 
		endwhile;
	endif;
get_footer(); 

